import React from 'react';
import MainNav from './MainNav';
import Progress from './UserProgress';
import UserStats from './UserStats';

function Dashboard() {
    return (
        <main className='h-screen'>
            <MainNav />
            <Progress />
            <UserStats />
        </main>
    );  
}

export default Dashboard;
